import Typewriter from 'typewriter-effect';

export default function Home() {
    return (
        <Typewriter
            options={{
                strings: ['designer', 'gamer', 'researcher', 'developer'],
                autoStart: true,
                loop: true,
                delay: 55,
                deleteSpeed: 15,
            }}
        />
        // <div className="container ">
